import Header from './Components/Header';
import './App.css';
import Button from "./Components/Button";
import image from "./Assets/bluestudy.png"
import daydreamadult from './Assets/daydreamadult.jpeg'
const App = () => {
  return (
    <div className="w-full h-screen">
      <Header />
      <div className='  flex mt-[150px] mb-[150px] justify-between mx-[100px]'>
        <div className='w-[750px] h-[350px] '>
          <p className='text-vividblue text-6xl font-medium font-customfont'>Step out of the shadows of <span className="underline decoration-pumpkinyellow">maladaptive daydreaming</span> and step into the spotlight of a purpose-driven life.
          </p>
          <div>
            <Button text="Begin your story" to="/signup"></Button>
          </div>
        </div>
        <img src={daydreamadult} alt="dreaminggirl" className='w-[650px] h-[500px] rotate-45'></img> 

      </div>

    </div>
  )
}
export default App;
